import React, { useState } from "react";
import "./App.css";
import Utility from "./function/utility"
import LoginPage from "./pages/LoginPage";

export default function App() {

  const [user, setUser] = useState([]);

  const getUserInfo = (userdata) => {

    setUser(userdata)
  };
  const testFetch = () => {
    try {
      Utility.CheckAccessTokenExpiresIn().then((v) => {
        console.log(v);
        const request = {
          method: "POST",
          url: "test",
          body: JSON.stringify({ test: "tere" }),
          ContentType: "application/json; charset=UTF-8",
          Authorization: `Bearer ${1}`,
        };

        Utility.FetchRequest(request)
          .then((result) => {
            console.log(result);
          })
          .catch((err) => {
            if (err.error ==="Unauthorized") {
              Utility.UserUnauthorized()
            }
          });
      }).catch((err) => {
        // Handle other errors related to checkAccessTokenExpiresIn
        console.log(err);
      });
    } catch (error) {
      console.log(error);
      alert("Something went wrong");
    }
  };
  return (
    <div>
      {user.length === 0 ? (
        <div>
          <LoginPage getUserInfo={getUserInfo} />
        </div>
      ) : (
        <div>
       <button onClick={()=>testFetch()}>3232</button>
       </div>
      )}
    </div>
  );
}
